import React, { useState } from 'react';
import { StyleSheet, Text, View } from 'react-native';
import MapView, { Marker } from "react-native-maps";

export default function App() {
  const [landmarks, setLandmarks] = useState([]);

  return (
    <>
      <View style={styles.container}>
        <MapView style={styles.map} initialRegion={{
          latitude: -37.8125,
          longitude: 145,
          latitudeDelta: 0.05,
          longitudeDelta: 0.05,
        }}>
          {landmarks.map((landmark) =>
            <Marker coordinate={{ latitude: landmark.Latitude, longitude: landmark.Longitude }} />
          )}
        </MapView>
        <View style={styles.toolbar}>
          <Text style={styles.logo}>Landmark Remark</Text>
          <Text style={styles.link}>Add</Text>
        </View>
      </View>
    </>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  map: {
    flex: 1,
    width: '100%',
    height: '100%',
  },
  toolbar: {
    flex: 0,
    padding: 20,
    flexDirection: 'row',
  },
  logo: {
    flex: 1,
    fontSize: 16,
    fontWeight: 'bold',
  },
  link: {
    fontSize: 16,
    color: '#3366ff',
  }
});
